#include <iostream>
#include <algorithm>

//    
class Solution {
public:


bool isAnagram(std::string s, std::string t) {
    if (s.size() != t.size()) return false;
    sort(s.begin(), s.end());
    sort(t.begin(), t.end());
    return s == t;

    }
};


int main()
{
    Solution a;
    std::string s ="";

    std::string t="";
    if (a.isAnagram(s,t))
        std::cout << "true";
    else
        std::cout <<"false";
}